function toIcon() {

    let icons = document.querySelectorAll('i.icon');
    // icons.forEach(icon => {
    //     if (icon.firstElementChild) icon.firstElementChild.remove()
    // })

    icons.forEach(function(icon, i) {
        if (icon.getAttribute('icon-name')) {

            if (!icon.querySelector('svg')) {
                let name = icon.getAttribute('icon-name');
                let iconEl = new DOMParser().parseFromString(iconBase[name], 'text/html').querySelector('svg');
                
                iconEl.style.fill = `#${icon.getAttribute('color') || 424242}`;
                iconEl.querySelectorAll('path').forEach(path => path.style.fill = `#${icon.getAttribute('color') || 424242}`);
                iconEl.querySelectorAll('circle').forEach(circle => circle.style.fill = `#${icon.getAttribute('color') || 424242}`);
                iconEl.style.width = icon.getAttribute('width') || 15+'px'
                iconEl.style.height = icon.getAttribute('width') || 15+'px'

                icon.style.color = `#${icon.getAttribute('color') || 424242}`;
                icon.style.width = icon.getAttribute('width') + 'px' || 15+'px'
                icon.style.height = icon.getAttribute('width') + 'px' || 15+'px'
    
                icon.appendChild(iconEl);
            }
        }
    })
}
toIcon();
